                if (clickTimeout) clearTimeout(clickTimeout); // Clear the previous timeout
        
                Object.keys(params.selected).forEach(name => {
                    if (params.selected[name]) {
                        chart.dispatchAction({
                            type: 'legendUnSelect',
                            name: name
                        });
                    }
                });

                chart.dispatchAction({
                    type: 'legendSelect',
                    name: params.name
                });


